using System;\nusing System.Collections.Generic;\nusing System.Collections.ObjectModel;\n\npublic class ClassA\n{\n    private Collection<string> strings;\n\n    public Collection<string> Strings { get { return strings; } }\n\n    public ClassA(IEnumerable<string> strings)\n    {\n        // Convert the IEnumerable<string> to a Collection<string>\n        this.strings = new Collection<string>(new List<string>(strings));\n    }\n}\n\n// Example usage\npublic class MainClass\n{\n    public static void Main()\n    {\n        IEnumerable<string> inputStrings = new List<string> { "one", "two", "three" };\n        ClassA classAInstance = new ClassA(inputStrings);\n\n        foreach (var str in classAInstance.Strings)\n        {\n            Console.WriteLine(str);\n        }\n    }\n}